import React from "react";
import Navigation from "../../components/Navigation";

const Home = () => {
    return (
        <>
            <Navigation />
            <section className="container mx-auto px-4">
                <div className="flex justify-between">
                    <div>kiri</div>
                    <div>kanan</div>
                </div>
            </section>
        </>
    );
};

export default Home;
